INSERT INTO `board_info` VALUES (173,1,'샤넬 쉐브론 이쁘','중고를 500주고 사고 싶진않고 새거 살까?','2023-01-01 16:04:14',NULL,25,56,0),(175,3,'다이슨 에어랩 재고 언제 들어오는거야 ? ','맨날 재고가 없어, 빨리사고 싶은데 언제 들어오냐!!! ','2023-01-27 16:07:16',NULL,8,58,0),(177,2,'쿠팡에서 파는 스투시','왤케 싸? 안봐도 당연히 짭인가 ?','2023-02-03 16:09:30',NULL,948,56,0),(182,107,'헤헤 신발샀다','가성비로 하나삼 ㅎㅎ\n1치킨','2023-02-03 15:30:42',NULL,2,NULL,0),(184,25,'사파리 재킷','이거 봄에 가끔 입고싶은데\n\n어때보여?\n\n가격은 저렴한편','2023-02-10 12:44:37',NULL,0,NULL,0),(185,4,'경량패딩 사려고','5만원 내에서 사려고 괜찮지?','2023-02-21 16:45:45',NULL,4,57,0),(186,28,'기본 자켓으로 이거 어때?','빈폴 자켓인데 봄, 가을에 기본템으로 입기 좋을 것 같아서\n사이즈도 그렇고 되게 맘에드는데 가격이 46만원이야...솔직히 좀 부담이긴한데 그래도 원단 좋다니까 한 번 사서 오래 입을거 생각하고 지를까??','2023-02-21 14:46:57',NULL,27,57,0),(187,22,'명품백을 하나만 산다면? 샤넬 vs 셀린느','20후 여자입니다..!\n1억 저축한 기념으로 가방을 하나 사려고 하는데요..\n명품가방은 하나도 없는 상태입니다. 10만원 이하 가방만 몇 개 있네요\n\n1억 모으면 가방 하나 사자는 스스로의(?) 약속을 했으니 이제 지킬 때가 온 거 같아요.. 이번에 한 번 사면 몇년 간 또 안 살 거 같네요\n\n고민은\n이번에 구매하면 10년 20년 들고다닐 수 있는 클래식한 거(샤넬)\nvs\n지금 나에게 가장 잘 어울리는, 유행 타지만 비교적 가격이 낮은 것 (셀린느)\n\n중에 고민되네요! 님들은 어떤 선택을 하실건가요??','2023-02-21 16:30:36',NULL,9,56,0),(191,160,'삶의 질은 로봇청소기에서','그것도 비싼게 최고인듯 ..\n\n45만원짜리 로봇청소기 물걸레 겸용이지만\n\n물걸레 따로 세척도 건조도 해야되거 잘 안되는 느낌때문에 잘안쓰다가 청소기 마저도 조금 멍청해져서 바꿈\n\n물걸레 로봇청소기 또한 에브리봇? 하는데 싼거라 그런지 애도 멍청\n\n바꾼 로보락은 대만족.. 멍청하지가 않고 깨끗해서 좋음\n\n혼자사는 사람 한테는 필수인듯 ','2023-02-26 16:56:34',NULL,9,56,0),(192,6,'여친한테 선물할건데 미니백 어때?','100만원 정도로 생각하고 출퇴근할때 색깔이랑 브랜드 추천좀 해줘 ','2023-02-07 16:59:38',NULL,0,NULL,0),(193,159,'까시미아 캄포클레식','까사미아 캄포클레식 오늘의집에서 20% 세일하는데,\n사도 될까요??\n\n이런 조합으로 원하는데...\n\n신세계 임직원할인 부탁드립니다 ㅠㅠ','2023-02-03 17:03:30',NULL,11,56,0),(194,8,'쿠팡으로 샐러드 시켜먹는데.','쿠팡 으로 샐러드 2개 시켜먹는거 오바인가?','2023-02-14 17:03:46',NULL,0,NULL,0),(195,10,'마일리지 카드 말고 피킹율 좋은 카드 추천 좀 해줘','현재 국민카드 올쇼핑 티타늄, 2X 하나카드(아직 쓰고있지 후후~)로\nGmarket 같은 온라인 쇼핑, 이마트 쇼핑, 아파트관리비, 통신비는 짭짤하게 할인 받는 중!','2023-02-26 17:06:26',NULL,0,NULL,0),(196,13,'와이프 선물 루이비통 에피 어때?','매장가서 보니 이게 제일 눈에 들어오는데\n\n600만원 초반대\n\n40대 초반 애키우는 전업주부 와이프야\n\n별로면 다른거 추천 좀..\n\n에피.. 에삐..','2023-02-27 17:06:38',NULL,0,NULL,0),(197,6,'롤랙스 선택 장애 오는데 ','둘중 어떳게 더 낫나요?','2023-02-27 17:19:34',NULL,0,NULL,0),(198,11,'시계 쿼츠 구매하려해(태그vs프콘)','나는 평생 시계 차본적도 없는데 왜 사냐면…\n그냥 장신구용…\n오토사서 관리할 자신 없어서 좀 그렇고…\n둘중에 뭐가 더 괜찮아??\n태그 할인후 150\n프콘 68','2023-02-27 17:22:23',NULL,0,NULL,0),(200,13,'pc 견적 봐주실 능력자 필요해요!','주로 하는 건 게임(롤, 오버워치)입니다.\n이대로 구입하면 될까요?!','2023-02-27 17:24:12',NULL,1,NULL,0),(202,27,'스벅언니 오빠들 이거 사도 되는거야?','같은거야? 매장서 사면 호구? 아님 인터넷에서 사면 스마트한 쇼퍼?\n이거 두개사면 5만원도 안해. 매장서 한개 39000 원이거든\n알려줘. 사도 되는건지\n선물할건데 괜히 돈 좀 아끼려디 욕먹음 안되자나','2023-02-27 17:25:57',NULL,5,56,0),(204,1,'휴대폰 잘사는 방법','휴대폰은 어디서 사는게 가장 저렴해?\n이번에 부모님 폰 바꿔드리려고 하는데(삼성폰)\n대리점이 나은가?\n잘 아는 사람 있으면 지혜를 나눠줘🌷','2023-02-27 17:27:35',NULL,12,56,0),(205,104,'나이키 에어맥스97','에어맥스97사고 싶은데 디자인은 거 비슷한데가격 차이가 왜이렇게 심하게 나는건가요','2023-02-27 17:28:06',NULL,0,NULL,0),(206,118,'사까마까 지하철에서 고민','https://naver.me/xJa6yCuU\n사마라 언냐들','2023-02-27 17:29:32',NULL,0,NULL,0),(207,14,'쇼파 추천 좀 해줘 ','에싸 자코모 중에 뭐가 더 좋나요\n다른 좋은 브랜드 있으면 추천해주세요','2023-02-27 17:31:44',NULL,0,NULL,0),(208,143,'카페 의자 잘 아시는 분','혹시 이 아이들 정보 좀 알 수 있을까요ㅠㅠ\n사장님께 여쭤봤는데 한꺼번에 인터넷 주문해서 어디껀지 모르신다고 하심ㅠㅠㅠㅠㅠ\n의자에 아무것도 안 적혀있어요 흑흑\n\n','2023-02-27 17:32:02',NULL,0,NULL,0),(209,3,'신용카드 추천좀 부탁함','신용카드 추천부탁합니다~ 지금은 국민카드 탄탄대로 플래티넘 쓰는데 2024년도에 유효기간 만료로 더 이상 갱신이 불가능하다고 해서.\n혜택 좋은 카드로 갈아타고 싶거든?\n인터넷 쇼핑, 마트, 아울렛, 외식, 배달의 민족 등','2023-02-27 17:33:18',NULL,12,56,0),(210,9,'티비 이거사도되나요..','티비 이거 지금사도되나요?\n\n티비 잘몰라서 찾아보는중이긴 한데\n\n잘몰르겠어요\n\n저거. 사면 호갱되나요?','2023-02-27 17:33:49',NULL,1,NULL,0),(211,15,'캐릭터 마우스 패드 여러분이라면?','여러분이라면 어떤 걸로?','2023-02-27 17:34:14',NULL,6,59,0),(212,12,'오뚜기 탕 추천 해줘','회사 복지몰에서 할인 해서 사려고 하는데 뭐가 맛있음?\n\n일단 블라에서 수원식 우거지갈비탕 맛있다는 글 본듯','2023-02-27 17:35:19',NULL,0,NULL,0),(213,16,'사고 싶은 조던이 있는데','내가 지금 에어포스 주니어 230은 있는데 사이즈가 진짜 딱 좋아\n근데 내가 지금 사고 싶은 건 우먼 모델밖에 없어 ㅠㅠ\n우먼 230이랑 주니어 230이랑 차이 클까??\n우먼은 225로 사야 되나 ㅜ 크게 신는 걸 별로 안 좋아하기도 하고...\n\n크림이나 솔닷으로 보고 있어서 사이즈별 가격도 천차만별이라 넘 고민 돼','2023-02-27 17:37:00',NULL,12,56,0),(214,16,'토트넘 굿즈 사봤음 ','옆나라 살아서 간간히 비행기타고 직관가는데 굿즈좀 사봤음','2023-02-27 17:37:35',NULL,4,59,0),(215,157,'패딩 사라마라 참견 해줄 사람','패딩 맘에 드는게 있어서 주문했는데\n\n입어보니 핏도 이쁘고\n일반 패딩처럼 부해보이지 않아서 맘에 드는데\n여성 브랜드꺼라 막 따뜻하진 않을거 같네\n\n원가 200 넘는거 할인해서 50 후반대라\n이 돈이면 아웃도어꺼를 사는게 맞나 싶고\n\n소재는 사고나서 다시 보니 모피(?!) 이고\n안감이 모두 털인데 구스 충전재는 따로 없어보여!!','2023-02-27 17:39:31',NULL,0,NULL,0),(216,2,'저가형 가죽쇼파','5년정도 쓰고 교체할 생각하고있고 가격은 40-80만원 천연면피가죽이야, 혹시 괜찮은 저가형 가죽소파 알면 추천도 부탁해!','2023-02-27 17:41:24',NULL,5,56,0),(217,13,'이번달 올영세일 하나요!','지난달 25~27일 세일했던거 같은데\n이번달도 25~27일 세일하나요!\n\n아무것도 안사고 존버중인데ㅠㅠ\n\n이쁘고 잘생기신 올영님들 세일계획 알려주세요ㅠㅠㅠ','2023-02-27 17:42:19',NULL,15,56,0),(218,13,'우리집 밥솥인데','딱 네그릇만 밥 지을 수 있어서 그냥 좀 큰걸로 살까..?','2023-02-27 17:43:15',NULL,0,NULL,0),(219,30,'lg식기세척기 추천점','친구가 이번에 결혼해서 다른친구 3명이서 100~150 사이 식기세척기 하나 해주려고하는데 추천점해주세요\n결혼하는친구집 가전이 다 lg라서 이왕하는거 lg로 묶는게 좋을거같아서요','2023-02-27 17:43:37',NULL,4,57,0),(220,161,'세일 안해요','당분간 안할듯','2023-02-27 17:46:37',NULL,2,56,1),(221,34,'맥북 에어 산다vs안산다','사실 회사에서 계속 노트북 보느라 집에서는 아이패드조차 잘 꺼내지 않고 내 개인노트북은 안 킨지 어언 4갸월째이지만…\n\n지금 포토샵 같은 디자인 툴 배울까 고민중이기도 하고 사두면 쓸모 있지 않을까됴 싶어서..\n\n고민이네… 흐음\n지금 또 교육할인 들어가더라고. 난 아직 자격이 있어서 더 고민됨','2023-02-27 17:46:47',NULL,1,NULL,0),(222,144,'다이슨 에어랩 블루코퍼 vs 니켈코퍼','드디어 사려고 맘먹었는데 인터넷에도 블루가 풀려서,,🤍\n여러분이라면 무슨 선택을!?!?\n\n블루가 더 끌리는데 나중에 색이 질리지 않을까 하는 걱정\n니켈이 더 클래식한 느낌이라 .. 고민된다 ㅠ\n\n혹 댓글에 이유도 적어주면 너무 감사 😉','2023-02-27 17:47:05',NULL,7,57,0),(223,14,'우리집 더글로리 박연진 지방시 백\n','이거 우리나라엔 안팔아...? 거의 해외 구매대행에만 스몰로 파네 ㅠㅠ','2023-02-27 17:48:03',NULL,1,NULL,0),(224,161,'올영','세일함 대기','2023-02-27 17:49:41',NULL,18,56,1),(225,25,'발망 선글라스 어때?!','해외출장있어서 16만원에 질렀는데 과소비인가 싶네..','2023-02-27 17:50:41',NULL,4,NULL,0),(226,22,'남자 카드지갑 투표 좀 도와주라','남자이구, 30초반 본인 쓸꺼 고민중인데 뭐살까 ? ','2023-02-27 17:52:24',NULL,111,56,0),(227,30,'엄마 목걸이 사주고 싶은데','난 흙수저야\n엄마가 장신구 하나 갖고 있는게 없는데\n목걸이나 반지 사줄가 하거든\n\n돈없어서 단호하게 최대 20마넌\n생각즁\n\n근데 금은방 들어가면\n20만원으로 살 수 있어..?\n\n금목걸이 같은겅','2023-02-27 17:54:24',NULL,25,57,0),(228,34,'만난지 2주된 남친한테 생일선물 뭐 사주지','나이는 좀 있으니까 좋은 걸 해주고 싶은데 2주밖에 안되서 큰 돈을 쓰면 부담스러워 할 것 같고 어렵다…. 차라리 몇달이 지났으면 시원하게 돈쭐 내줄텐데','2023-02-27 17:56:46',NULL,1,NULL,0),(229,104,'여자아